webpackJsonp([96143512389013],{702:function(a,n){a.exports={data:{markdownRemark:{html:'<p>Two-factor authentication enables you to add an extra layer of protection from getting your account compromised. You can set up two-factor authentication using any device capable of generating Time-based One-Time Password (TOTP) authentication codes (RFC-6238) to log in to your HackerOne account. You can use Google Authenticator or Duo Mobile or any other compatible application to generate the codes.</p>\n<p>To set up two-factor authentication for your account:</p>\n<ol>\n<li>Go your profile’s  <strong>Settings > Authentication</strong>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-7c346.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 34.98845265588914%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="2fa-1"\n        title=""\n        src="/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-e7ffa.png"\n        srcset="/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-49813.png 125w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-dc8a5.png 250w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-e7ffa.png 500w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-dda24.png 750w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-c5f18.png 1000w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-22484.png 1500w,\n/static/2fa-1-23de3f0cc122102aa0b8ea2540e82fa1-7c346.png 1732w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Click <strong>Set up</strong>.</li>\n<li>Add your phone number and click <strong>Next</strong>.</li>\n<li>Enter the verification code sent to your phone number. This will enable account recovery.</li>\n<li>Click <strong>Turn on</strong> to enable two-factor authentication.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-598a3.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.29447852760736%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="2fa-4"\n        title=""\n        src="/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-e7ffa.png"\n        srcset="/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-49813.png 125w,\n/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-dc8a5.png 250w,\n/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-e7ffa.png 500w,\n/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-dda24.png 750w,\n/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-c5f18.png 1000w,\n/static/2fa-4-9f87f45aae146da7b521ffaef3304bb0-598a3.png 1304w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Scan the QR  code in your authenticator app or enter the code manually.</li>\n<li>Store your backup codes.</li>\n<li>Enter the verification code from your authenticator app as well as one of the backup codes from the previous page.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2fa-7-5a961c4446eb8909397641d2aa866e01-63709.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.38461538461537%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="2fa-7"\n        title=""\n        src="/static/2fa-7-5a961c4446eb8909397641d2aa866e01-e7ffa.png"\n        srcset="/static/2fa-7-5a961c4446eb8909397641d2aa866e01-49813.png 125w,\n/static/2fa-7-5a961c4446eb8909397641d2aa866e01-dc8a5.png 250w,\n/static/2fa-7-5a961c4446eb8909397641d2aa866e01-e7ffa.png 500w,\n/static/2fa-7-5a961c4446eb8909397641d2aa866e01-dda24.png 750w,\n/static/2fa-7-5a961c4446eb8909397641d2aa866e01-c5f18.png 1000w,\n/static/2fa-7-5a961c4446eb8909397641d2aa866e01-63709.png 1300w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Click <strong>Save</strong>.</li>\n</ol>\n<p>Once your two-factor authentication is successfully enabled, you’ll be prompted to enter a 6-digit verification code from your authenticator app to log in to your HackerOne account.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2fa-8-393bda29b58884686454fd1bf7779514-06008.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 402px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 93.78109452736318%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="2fa-8"\n        title=""\n        src="/static/2fa-8-393bda29b58884686454fd1bf7779514-892de.png"\n        srcset="/static/2fa-8-393bda29b58884686454fd1bf7779514-14e20.png 125w,\n/static/2fa-8-393bda29b58884686454fd1bf7779514-13201.png 250w,\n/static/2fa-8-393bda29b58884686454fd1bf7779514-892de.png 500w,\n/static/2fa-8-393bda29b58884686454fd1bf7779514-a9175.png 750w,\n/static/2fa-8-393bda29b58884686454fd1bf7779514-06008.png 804w"\n        sizes="(max-width: 402px) 100vw, 402px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>You can choose to change your account recovery phone number, turn off two-factor authentication or regenerate your backup codes.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-73a11.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 53.76344086021505%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="2fa-9"\n        title=""\n        src="/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-e7ffa.png"\n        srcset="/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-49813.png 125w,\n/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-dc8a5.png 250w,\n/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-e7ffa.png 500w,\n/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-dda24.png 750w,\n/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-c5f18.png 1000w,\n/static/2fa-9-7b9ae4f65485978d23831d6e2de396a6-73a11.png 1302w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{title:"Two-Factor Authentication",id:"hackers/two-factor-authentication",path:"/hackers/two-factor-authentication.html",description:null}}},pathContext:{}}}});
